class Maps(object):
    def __init__(self, imagesx, imagesy, campaign_text_check=[]):
        
        self.campaign_text_check = campaign_text_check
        
        self.imagesx = imagesx
        self.imagesy = imagesy
        self.mainx = 295
        self.mainy = 215
        self.character = pygame.image.load(os.path.join(os.path.sep.join(os.path.dirname(os.path.realpath(__file__)).split(os.path.sep)[:-1]), 'images', '')+'character.png')

        self.ship_spawnarea_x = (-150, 300)
        self.ship_spawnarea_y = (-1000, 300)
        
        self.pacific_spawnarea_x = (-500, 300)
        self.pacific_spawnarea_y = (-1300, 0)
        
        self.barren_spawnarea_x = (-300, 600)
        self.barren_spawnarea_y = (-1000, 200)
        
